{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":3570631,"sourceType":"datasetVersion","datasetId":2145411}],"dockerImageVersionId":30618,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/busemngn/cyclistic-bike-share-case-study-by-buse-mengen?scriptVersionId=165713212\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Cyclistic Bike-Share Case Study\n_Author:_ Buse Mengen\n\n_Date:_ 02-04-2024\n\n<a id=\"section-one\"></a>\n## 1. Summary\n\nIn this **Cyclistic bike-share analysis case study**, the primary business task is to understand how annual members and casual riders utilize Cyclistic bikes differently. The company, with a fleet of 5,824 geotracked bicycles across 692 stations in Chicago, has traditionally focused on general awareness and broad consumer appeal through flexible pricing plans. However, the director of marketing, Lily Moreno, believes that the future success of Cyclistic hinges on maximizing annual memberships. To achieve this, the team aims to design a new marketing strategy to convert casual riders into annual members.\n\nUsing R, I analyzed user trends, examining Cyclistic's historical bike trip data to identify patterns and insights. The recommendations, derived from the data analysis, are presented at the end of the notebook, providing actionable insights to guide the development of a targeted marketing program. The ultimate goal is to secure approval from Cyclistic's executive team and contribute to the company's strategic growth.\n","metadata":{}},{"cell_type":"markdown","source":"<a id=\"section-two\"></a>\n## 2. Intoduction\n\n### About the Company\n\n_Cyclistic_, a bike-sharing company launched in 2016, has expanded its program to include 5,824 geotracked bicycles across 692 stations in Chicago. The company has primarily focused on building general awareness and attracting broad consumer segments through flexible pricing plans, including single-ride passes, full-day passes, and annual memberships. \n\nIt is a bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use the bikes to commute to work each day.\n\n### Business Task\n\nCyclistic's financial analysts have determined that annual members are more profitable than casual riders. In a shift of strategy, the company aims to convert casual riders into annual members to maximize growth. The goal is to design marketing strategies that leverage the existing awareness among casual riders, understanding the differences between annual members and casual riders, exploring reasons for casual riders to purchase a membership, and considering the impact of digital media on marketing tactics. The focus is on analyzing historical bike trip data to identify trends and inform the conversion strategy. Three questions will guide the future marketing program:\n\n   1. How do annual members and casual riders use Cyclistic bikes differently?\n  \n   2. Why would casual riders buy Cyclistic annual memberships?\n  \n   3. How can Cyclistic use digital media to influence casual riders to become members?\n  \n* The focus of this analysis will be on the first question: _How do annual members and casual riders use Cyclistic bikes differently?_\n\n### Approach\n\nThe dataset for this case study is sourced from Cyclistic, encompassing trip history data from the years late 2021 and early 2022.\n\nGiven the project's objective of uncovering distinct trends among Cyclistic's members and casual riders, the analysis is concentrated on three key aspects:\n \n   1. Uncovering patterns in users' bike type choices.\n  \n   2. Investigating how average trip duration varies across user types by weekday and hour.\n  \n   3. Examining differences in the number of trips between user types on both weekdays and hourly intervals.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"section-three\"></a>\n## 3. Prepare Data\n\n### The Dataset\n\n[Cyclistic’s historical trip data](https://divvy-tripdata.s3.amazonaws.com/index.html) is public data that can be used to explore how different customer types are using Cyclistic bikes. However, using riders’ personally identifiable information (PII) is prohibited due to data-privacy issues. This means that it won’t be possible to connect pass purchases to credit card numbers to determine if casual riders live in the Cyclistic service area or if they have purchased multiple single passes.\n\nThe data has been made available by Motivate International Inc. under this [license](https://divvybikes.com/data-license-agreement).\n","metadata":{}},{"cell_type":"code","source":"# Install packages\nlibrary(tidyverse)\nlibrary(lubridate)\nlibrary(janitor)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2024-03-06T12:54:28.133886Z","iopub.execute_input":"2024-03-06T12:54:28.136086Z","iopub.status.idle":"2024-03-06T12:54:29.582765Z"},"collapsed":true,"jupyter":{"outputs_hidden":true},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n\u001b[32m✔\u001b[39m \u001b[34mdplyr   