le customers tend to use electric bikes more than classic ones.\n* Subscribers tend to have a similar average duration for both classic and electric bikes.\n* Customers, on the other hand, tend to have longer trips when using classic bikes.\n* Notably, customers utilizing docked bikes embark on significantly longer journeys compared to other bike types.","metadata":{}},{"cell_type":"code","source":"trips %>% \n    select(c(weekday, user_type, duration_min)) %>%\n    group_by(weekday, user_type) %>% \n    summarise(duration_min = mean(duration_min)) %>% \n    ggplot(aes(x = weekday, y = duration_min, fill = user_type)) +\n        geom_bar(stat = \"identity\") +\n        theme(legend.position = \"top\", legend.title = element_blank(),\n              axis.text.x = element_text(angle = 30)) +\n        facet_grid(~user_type) +\n        ggtitle(\"Trend of Trip Duration Minutes of Users\", \"by weekdays\") + \n        labs(x = \"Weekday\", y = \"Trip Duration\")\noptions(repr.plot.width = 10, repr.plot.height = 9)","metadata":{"execution":{"iopub.status.busy":"2024-03-06T12:58:53.281754Z","iopub.execute_input":"2024-03-06T12:58:53.28339Z","iopub.status.idle":"2024-03-06T12:58:54.058402Z"},"trusted":true},"execution_count":14,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'weekday'. You can override using the\n`.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABDgAAAPACAIAAABfFF4iAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2BT5dvH8etkt0npoMwKskGQKVNBZKkoS0AZinsgAoIgoggoIC62IuIej4oT\nEcW9FRQU/YsMBQFBNhRK27TNOs+LQChtk6aQNnfD9/MqOeM+133nnJP8Mk40XdcFAAAAAFRi\niHYBAAAAAFAQQQUAAACAcggqAAAAAJRDUAEAAACgHIIKAAAAAOUQVAAAAAAoh6ACAAAAQDkE\nFQAAAADKKWdBZfXYploY+vzvQFTKm1s3WdO0FYdzT7Md596vb+h2XqrDUqXJfYXnnuYg/Hpv\nC03Ten67+zSLLLxFk9WRVrth/5vuXv7HodNsPCIi1dNwpP91tX8QUhrODLqQL7eR3eJf7OuM\nvLIvMupC79h+7uzf/EMUbIHvhtTXNK3Fvb+WTo0AAEAVpmgXUDK21Jr16p2IAbov+5+tezTN\nVLdurfyLVbMay7qy