AFYHhQoA\nAAAAAFgdFCoAAAAAAGB1UKgAAAAAAIDVQaECAAAAAABWB4UKAAAAAABYHRQqAAAAAABgdVCo\nAAAAAACA1UGhAgAAAAAAVudPvkuGZeVK7rMAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":540,"height":480}}}]},{"cell_type":"markdown","source":"*__Discussion:__*\n\n* Subscribers consistently utilize bikes even for short-distance trips, maintaining a nearly uniform average duration across all weekdays. \n* Conversely, customers predominantly opt for longer journeys, with the minimum average duration of approximately 20 minutes observed on Tuesdays.\n\n#### Categorizing User Behavior\n\nIn dissecting user trip duration patterns, I categorize user types into distinct groups defined by their mean trip lengths. These groups are delineated as follows:\n\n* _High length:_ Users falling within the 4th quartile of mean trip length.\n* _Moderate length:_ Users falling within the 3rd quartile of mean trip length.\n* _Light length:_ Users falling within the 2nd quartile of mean trip length.\n* _Low length:_ Users falling within the 1st quartile of mean trip length.\n","metadata":{}},{"cell_type":"code","source":"# Subscribers' user behavior\nsubscriber_trips <- trips %>%\n    filter(user_type == \"subscriber\") %>%\n    group_by(started_date) %>% \n    summarise(avg_duration_min = mean(duration_min)) %>%\n    mutate(quartile = as.character(as.numeric(cut(avg_duration_min, \n                                       quantile(avg_duration_min, \n                                                probs=c(0, 0.25,0.5, 0.75, 1)), \n                                       include.lowest=TRUE))),\n         group = case_when(quartile == \"1\" ~ \"Low length\",\n                           quartile == \"2\" ~ \"Light length\",\n                           quartile == \"3\" ~ \"Moderate length\",\n                           quartile == \"4\" ~ \"High length\")) %>%\n    mutate(group = fct_relevel(group, c(\"Low length\",\"Light length\", \n                                      \"Moderate length\", \"High length\")))\nhead(subscriber_trips)","metadata":{"execution":{"iopub.status.busy":"2024-03-06T12:58:54.062989Z","iopub.execute_input":"2024-03-06T12:58:54.06451Z","iopub.status.idle":"2024-03-06T12:58:54.333732Z"},"trusted":true},"execution_count":15,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 4</caption>\n<thead>\n\t<tr><th scope=col>started_date</th><th scope=col>avg_duration_min</th><th scope=col>quartile</th><th scope=col>group</th></tr>\n\t<tr><th scope=col>&lt;date&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;fct&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>2021-10-01</td><td>13.30399</td><td>4</td><td>High length    </td></tr>\n\t<tr><td>2021-10-02</td><td>13.96054</td><td>4</td><td>High length    </td></tr>\n\t<tr><td>2021-10-03</td><td>14.70659</td><td>4</td><td>High length    </td></tr>\n\t<tr><td>2021-10-04</td><td>11.72264</td><td>3</td><td>Moderate length</td></tr>\n\t<tr><td>2021-10-05</td><td>12.17018</td><td>3</td><td>Moderate length</td></tr>\n\t<tr><td>2021-10-06</td><td>12.28243</td><td>4</td><td>High length    </td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 × 4\n\n| started_date &lt;date&gt; | avg_duration_min &lt;dbl&gt; | quartile &lt;chr&gt; | group &lt;fct&gt; |\n|---|---|---|---|\n| 2021-10-01 | 13.30399 | 4 | High length     |\n| 2021-10-02 | 13.96054 | 4 | High length     |\n| 2021-10-03 | 14.70659 | 4 | High length     |\n| 2021-10-04 | 11.72264 | 3 | Moderate length |\n| 2021-10-05 | 12.17018 | 3 | Moderate length |\n| 2021-10-06 | 12.28243 | 4 | High length     |\n\n","text/latex":"A tibble: 6 × 4\n\\begin{tabular}{llll}\n started\\_date & avg\\_duration\\_min & quartile & group\\\\\n <date> & <dbl> & <chr> & <fct>\\\\\n\\hline\n\t 2021-10-01 & 13.30399 & 4 & High length    \\\\\n\t 2021-10-02 & 13.96054 & 4 & High length    \\\\\n\t 2021-10-03 & 14.70659 & 4 & High length    \\\\\n\t 2021-10-04 & 11.72264 & 3 & Moderat