rmat = \"%H:%M\")) %>%\n    group_by(user_type, weekday, started_hour) %>%\n    summarise(trip_count = n()) %>%\n    ggplot(aes(x = started_hour, y = trip_count, fill = trip_count)) + \n    scale_fill_gradient(low = \"#F7DC6F\", high = \"#CB4335\")+\n    geom_bar(stat = 'identity', show.legend = TRUE) +\n    coord_flip() +\n    ggtitle(\"Intensity By Hours\") +\n    xlab(\"Hour\") + ylab(\"Number of Trips\") + labs(fill = \"Trip Count\") +\n    theme(axis.text.x = element_text(size = 6), axis.text.y = element_text(size = 5))+\n    theme(legend.position = \"top\")+\n    facet_grid(user_type ~ weekday)\noptions(repr.plot.width = 20, repr.plot.height = 10)","metadata":{"execution":{"iopub.status.busy":"2024-03-06T13:02:44.037189Z","iopub.execute_input":"2024-03-06T13:02:44.040123Z","iopub.status.idle":"2024-03-06T13:02:49.410179Z"},"trusted":true},"execution_count":34,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'user_type', 'weekday'. You can override\nusing the `.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT5f/A8c9lj+6WspcIAiIq04XKEvkCKoIoKOJGUHGgCCpLQBH5iiICKoo4\n+TlwouJAwY3gQMEBfkH2KKU7Sdvkfn8EQmibkLZ5Osj79Qfknrt87pPrPbnn7pNLNF3XBQAA\nAAAAAAAAAEBsMFR3AgAAAAAAAAAAAACqDgVCAAAAAAAAAAAAIIZQIAQAAAAAAAAAAABiCAVC\nAAAAAAAAAAAAIIZQIAQAAAAAAAAAAABiCAVCAAAAAAAAAAAAIIZQIAQAAAAAAAAAAABiCAVC\nAAAAAAAAAAAAIIYcDwXCh5onaZrW/4e91Z1IOaybcJqmaX1X7Ypu2NztM7RSDEZrSnqznpeO\nfPvnjErGdx/8UNM0k7VBqAU+69tU07TOj6yv5IoAAAAAAAAAAACgiKm6E6geui//2+9+MVmb\ndO3UuLpzEYl2Pgaj84Tm9QOTxZ78XTu3rXz7mS/fe2XSh39NvqBh5VcBAAAAAAAAAACAWup4\nuIOwAopdf59zzjkXDHq2uhJodtm0F154YWzrZBX5WBPP3xRky7ZduQc2T7/8JJ83/6FBF+X7\n9KisBQAAAAAAAAAAALVRjBYIq11qhwEjRozoVddeNauzJJ0w4eWvG1tNhXk/LdiVXzUrBQAA\nAAAAAAAAQA103BcIffnu4toZPMoMprSeSVYROVDsre5cokH37CvyVXcSAAAAAAAAAAAAtc9x\nWCDctORcTdOu33Rw7Uv3t2uUFGc3m6zO5u27PfD0p/4FlrZJs8R1EJGcbdM0TUs9aXH